INSERT INTO `comments` VALUES (178,0,'2010-01-19 19:12:00','MG','Till now the sugar price is 45 rupees and most of the sugar which we produce goes to the factories.  Also for electricity, the village is getting 24% while the city is getting first preference.',0,0,33227766),(179,0,'2010-01-19 19:14:22','MG','The total tonage for the sugar is 5500.  They are giving us 2500 and the other 3000 goes to the government or factory.  What is the use of working hard?  That is why we are protesting.',0,0,33227766),(180,0,'2010-01-19 19:19:18','MG','Here in Karnataka state, we already spoke to the Chief Minister 2.5 years back about this issue of raising sugar prices.  However, the Chief Minister has cheated us.  He has not taken any steps.  In other states, sugar prices are not going up.',0,0,33227766),(177,0,'2010-01-19 19:08:55','MG','Till now the government has not taken any precautions or steps on the price issue.  For example, for us the price is 4600 and they are giving to the companies more than 4000.',0,0,33227766),(181,1,'2010-01-19 19:23:17','MG','The fertilizer issue also, they have not taken any steps.  About the sugar cane issue, they are not allowing us to go to Vidhana Soudha and speak to the Chief Minister.',0,0,33227766),(183,1,'2010-01-19 19:29:24','MG','We have come down to Bangalore for the sugar cane strike, since the government is not cooperating with us.  That is why we have come here to protest.',0,0,33227766),(184,1,'2010-01-19 19:31:50','MG','We are protesting about sugar cane, about fertilizer, and about the electricity.',0,0,33227766),(185,1,'2010-01-19 19:37:53','MG','Whether it is sugar cane, or electricity, or fertilizer, the central government has closed their eyes to this issue.  They have not taken any action on this.',0,0,33227766),(186,1,'2010-01-19 19:39:36','MG','Every time they will be calling us for meeting, meeting, meeting, but they are not ready to do anything on this issue.  So we thought we will come down and get the problem solved.',0,0,33227766),(187,1,'2010-01-19 19:41:57','MG','I am coming from Tharitere and we have come here to talk about the sugarcane issue.  We have already told Yedurappa about this issue 15 days back, but nothing has been done.  When we asked, they tell that Yedurappa has gone to Hubli or somewhere.  But if he goes to Hubli, how long will it take him to come via flight?  Maybe 1 or 2 hours.  So I think government is playing fool on this issue.',0,0,33227766),(176,0,'2010-01-19 19:00:01','MG','We give the sugar for 1500 and they sell it for 6000 and we are not getting anything.',0,0,33227766),(173,6,'2010-01-19 17:50:06','MG','The price of sugar cane has been increased and we want to stop it.',0,0,33227766),(175,4,'2010-01-19 18:42:11','MG','If Chief Minister is not coming to meet us, we will go in front of Vidhana Soudha and fast and see to it that work will get done.',0,0,33227766),(191,0,'2010-01-20 12:49:48','MG','If you know your channel number, please enter the channel number now.',1,0,NULL),(195,0,'2010-01-22 19:39:31','MG','Test #2',0,0,11),(193,1,'2010-01-22 19:07:37','59.160.224.98','Youve Got a Friend In Me',0,0,11),(198,1,'2010-01-23 04:49:11','MG','Ranjita',0,0,22001100),(197,2,'2010-01-23 04:11:11','MG','Latif Alam',0,0,22001100),(200,3,'2010-01-23 05:10:37','MG','Bill Thies',0,0,22001100),(204,0,'2010-01-23 06:14:10','MG','Pushkar',0,0,22001100),(205,1,'2010-01-23 08:31:05','MG','Chaitanya',0,0,22001100),(206,1,'2010-01-23 08:54:55','MG','Latif moderated introduction',0,0,22001100),(207,2,'2010-01-23 08:56:38','MG','Ed Cutrell',0,0,22001100),(208,0,'2010-01-23 09:05:31','MG',NULL,0,0,22001100),(209,0,'2010-01-23 09:12:57','MG',NULL,0,0,22001100),(210,0,'2010-01-23 09:24:44','MG','Arnold ',0,0,22001100),(211,0,'2010-01-23 09:30:01','MG',NULL,0,0,22001100),(212,0,'2010-01-23 10:02:37','MG','Edit Text',0,0,22001100),(213,1,'2010-01-23 10:38:22','MG',NULL,0,0,22001100),(214,1,'2010-01-23 10:56:38','MG',NULL,0,0,22001100),(215,2,'2010-01-23 11:24:55','MG','Nik