and developing the village, and for that the President has awarded him Rs. 50,000 of cash and gold medal but the village people are telling there are some places where the Sarpanch have not taken any action on this.  And in Gram Panchayat one of the leaders by name Paras has told that he cleansed Nirmalpur Village but I don\'t know about this.  I think the part about Nirmalpur Village cleansing is a joke.  That is what I feel.  This is Vikas Gupta from Bhakatvar.  For further information call me on 9320071813.\"',0,0,12345),(421,49,'2010-02-11 15:32:13','MG','test',1,0,12345),(422,15,'2010-02-11 17:25:25','MG','test',1,0,12345),(423,51,'2010-02-12 01:15:46','MG','test',1,0,12345),(424,14,'2010-02-12 04:32:45','MG','test',1,0,12345),(425,19,'2010-02-12 04:58:01','MG','test',1,0,12345),(426,18,'2010-02-12 04:58:30','MG','test',1,0,12345),(427,16,'2010-02-12 06:23:18','MG','test',1,0,12345),(428,24,'2010-02-12 13:20:02','MG','test',1,0,12345),(429,47,'2010-02-12 16:38:38','18.111.35.115','Test Music',1,0,12345),(430,12,'2010-02-12 16:47:07','MG','test',1,0,12345),(431,24,'2010-02-13 07:48:06','MG','test',1,0,12345),(432,13,'2010-02-13 14:57:09','MG','test',1,0,12345),(433,9,'2010-02-14 04:49:40','MG','test',1,0,12345),(434,16,'2010-02-14 04:52:17','MG','test',1,0,12345),(435,14,'2010-02-14 04:55:11','MG','test',1,0,12345),(436,0,'2010-02-14 05:22:29','MG','test',1,0,12345),(438,20,'2010-02-14 12:04:35','MG','test',1,0,12345),(439,13,'2010-02-15 04:00:05','MG','test',1,0,12345),(440,9,'2010-02-15 12:09:44','MG','Happy Valentines Day',1,0,12345),(441,9,'2010-02-15 14:15:05','MG','test',1,0,12345),(442,4,'2010-02-15 14:21:26','MG','test',1,0,12345),(443,106,'2010-02-16 10:13:40','MG','Shivsena attacks: \"On Valentine\'s day, Shivsena were protesting and not allowing the lovers to participate in Valentines day.  In fact, on 14th Feb the police were watching over the protest.  Shivsena people made many lovers either to tie the rakhee or call them as brothers and sisters.  Lovers on Valentines day, they used to go to parks or give greetings or share SMS through mobile.  At one point of time, one of the couples had come to Sanjya Park Sarjuna Nagar.  When the couple saw the Shivsena Batalion they ran from there but they were found, so the boy told the Shivsena that the girl is his sister.  Once he told them Shivsena made the boy to tie the rakhee on the girls hand.  Because of that both of them became shamed.  -Prakash\"',0,0,12345),(444,135,'2010-02-16 14:15:10','MG','Beating of studnets in Ambikapur:  \"In Ambikapur the police have done the latti charge on PG college students.  In Sarguja, we have head office in Ambikapur.  Police have beaten the students left and right.  This incident happened on Feb 15 around 2:12pm.  Because of police behaviour the vice president in the college and NSU department are talking on this issue that police should apologise to the students.  Since the apology has not been done, the vice president of the college and the assistant professor of the college are talking on this issue.  Since the latti charge was happening the police have put the students in the room and beating them left and right.  The NSU department spoke that since the police have taken the laws in their hands, it is not right to beat the students.  Singdeva and Amarjit from the head office are making a meeting on this issue and trying to rectify about this serious issue. This is Prakash Gupta from CGNet.\"',0,0,12345),(445,1,'2010-02-17 02:46:19','MG','test',1,0,12345),(447,0,'2010-02-17 02:58:09','MG','Test from Bill',1,0,12345),(448,0,'2010-02-16 03:58:47','MG','Tamil Song',1,0,12345),(449,0,'2010-02-16 04:42:15','MG','test',1,0,12345),(450,0,'2010-02-16 10:34:10','MG','Double click to add info about this comment...:not able hear the comments',1,0,12345),(451,0,'2010-02-16 11:55:58','MG','Double click to add info about this comment...:no comments',1,0,12345),(452,0,'2010-02-16 11:57:08','MG','Double click to add info about this comment..